import React from "react";
import './navbar.css';
import logo from '../../assets/mvlogo1.svg';
const Navbar = () => {
    return(
        <div className="navbar__container"> 
        <img src={logo} alt="logo"/>
        <ul>
            <li>Home</li>

        </ul>
         </div>
    )
}
export default Navbar
